description:
Bán nhà mặt ngõ Tôn Đức Thắng - 2 thoáng ngõ trước nhà 2m sổ đỏ 26m từ tầng 2 đua ra 30m x 5 tầng giá 3,9 tỷ ( thông tin chuẩn tuyệt đối) 
 Sổ đỏ đẹp chính chủ pháp lý chuẩn.
LH ***

+ Vị trí nhà đẹp, mặt ngõ 2m thông, thẳng tắp, cách phố vài bước khu vực rất hiếm nhà bán. 
+ Khu vực trung tâm quận, gần nhiều trường Đại học, vài phút lên phố Cổ - Hoàn Kiếm khu vực đất rất giá trị. 
+ Nhà khung cột bê tông kiên cố gia đình tự xây móng riêng tường riêng. Lô góc mở đc nhiều cửa sổ rất thoáng sáng. 
- Tầng 1: Phòng khách, bếp, wc;
- Tầng 2: 1 phòng rộng, thông sàn;
- Tầng 3, 4: Mỗi tầng 1 phòng ngủ, wc;
- Tầng 5: Phòng thờ, sân phơi.
